%% VapeSocialNet Function
function [G,N,idx] = VSocialNet(A, vape,gender,strength,vapeTies,filename) 

% Centrality Analysis and Digraph
% indices of nodes with given characteristics
N = length(vape);
vInd = find(vape);
dInd = find(~vape);
mInd = find(gender==1);
fInd = find(gender==0);
mvInd = find(gender==1 & vape==1);
fvInd = find(gender==0 & vape==1);
mdInd = find(gender==1 & vape==0);
fdInd = find(gender==0 & vape==0);
idx = {vInd, mInd, fInd, mvInd, fvInd, dInd, mdInd, fdInd};

names = cellstr(string(1:length(A)));
G = digraph(A,names,'OmitSelfLoops');
G.Edges.Weight = strength';
AW = adjacency(G,G.Edges.Weight);

% Centrality calculations
inDw = centrality(G,'indegree','Importance',G.Edges.Weight);
outDw = centrality(G,'outdegree','Importance',G.Edges.Weight);
pr = centrality(G,'pagerank','MaxIterations',300,'FollowProbability',0.85);
prW = centrality(G,'pagerank','MaxIterations',300,'FollowProbability',0.85,'Importance',G.Edges.Weight);
inC = centrality(G,'incloseness');
outC = centrality(G,'outcloseness');
bt = centrality(G,'betweenness');
hubs = centrality(G,'hubs','MaxIterations',300);
hubsW = centrality(G,'hubs','MaxIterations',300,'Importance',G.Edges.Weight);
aut = centrality(G,'authorities','MaxIterations',300);
autW = centrality(G,'authorities','MaxIterations',300,'Importance',G.Edges.Weight);
%cCoef2 = clusteringcoef(A)';
cCoef=weighted_clust_coeff(A);
cCoefW=weighted_clust_coeff(AW);
%flowCo = flow_coef_bd(A)';

% add to DiGraph
G.Nodes.InDegree = indegree(G);
G.Nodes.InDegreeWeighted = inDw;
G.Nodes.OutDegree = outdegree(G);
G.Nodes.OutDegreeWeighted = outDw;
G.Nodes.PageRank = pr;
G.Nodes.PageRankWeighted = prW;
%G.Nodes.Eigenvector = norm_eig_cent;
G.Nodes.InCloseness = inC;
G.Nodes.OutCloseness = outC;
G.Nodes.Betweenness = 2*bt./((numnodes(G)-2)*(numnodes(G)-1)); %normalized probability
G.Nodes.Hubs = hubs;
G.Nodes.HubsWeighted = hubsW;
G.Nodes.Authorities = aut;
G.Nodes.AuthoritiesWeighted = autW;
G.Nodes.ClusteringCoefficient = cCoef; 
G.Nodes.ClusteringCoefficientWeighted = cCoefW; 

vapeTies(vapeTies==2)=NaN; % 2 inidicates division by zero
G.Nodes.VapeTies = vapeTies'; 

data = cell(1,width(G.Nodes)-1);
for i=2:width(G.Nodes)
    data{i-1} = G.Nodes.(i)(1:N);
end
C_avg = allStats(data, idx, N,filename);
writetable(G.Nodes,filename,'Sheet','Nodes','WriteRowNames',true);

% Plots 
%% DiGraph
figure();
subplot(2,2,1) % tie weights
h = plot(G,'Layout','force','MarkerSize',3,'NodeColor','k');
colormap(gca,cool(3));
h.EdgeCData=G.Edges.Weight;

title('Directed Tie Weights','FontSize', 16)
cb  = colorbar;
set(cb,'YTick',1:3,'FontSize',12);


subplot(2,2,2) % Page rank
h = plot(G,'Layout','force','MarkerSize',5);
colormap(gca,flip(autumn,1));
h.NodeCData=G.Nodes.PageRankWeighted;

title('PageRank – Weighted','FontSize', 16)
colorbar('FontSize',12);
% hide axes
set(gca,'XTickLabel',{' '})
set(gca,'YTickLabel',{' '})
set(gca,'YTick',[])
set(gca,'XTick',[])


subplot(2,2,3) % clustering coefficient
h = plot(G,'Layout','force','MarkerSize',5);
colormap(gca,flip(autumn,1));
h.NodeCData=G.Nodes.ClusteringCoefficientWeighted;

title('Clustering Coefficients – Weighted','FontSize', 16)
colorbar('FontSize',12);
% hide axes
set(gca,'XTickLabel',{' '})
set(gca,'YTickLabel',{' '})
set(gca,'YTick',[])
set(gca,'XTick',[])


subplot(2,2,4) % betweenness
h = plot(G,'Layout','force','MarkerSize',5);
colormap(gca,flip(autumn,1));
%h.NodeCData=bt; %substitute any centrality measure

h.NodeCData = G.Nodes.Betweenness;

title('Betweenness Centrality Scores','FontSize', 16)
colorbar('FontSize',12);
% hide axes
set(gca,'XTickLabel',{' '})
set(gca,'YTickLabel',{' '})
set(gca,'YTick',[])
set(gca,'XTick',[])


