%% Function to Calculate and Tabularize Gender/Vape Averages and TTests
function [T_f,T_stats,StdDev] = c_stats(vec, idx,N) 
% INPUT
%   vec: vector of individual node centrality values
%   idx: cell array of index vectors that identify nodes with the
%        respective characteristics (eg indices of males who vape)
%   N:   Number of Respondents
% OUTPUT
%   T_f:        Table of average values for nodes exhibiting certain
%               characteristics
%   T_stats:    Table of p values and confidence intervals
    
    avg_whole_school = mean(vec(1:N),'omitnan');
    avg_vape = mean(vec(idx{1}),'omitnan');
    avg_male = mean(vec(idx{2}),'omitnan');
    avg_female = mean(vec(idx{3}),'omitnan');
    avg_vape_male = mean(vec(idx{4}),'omitnan');
    avg_vape_female = mean(vec(idx{5}),'omitnan');
    avg_dont_vape = mean(vec(idx{6}),'omitnan');
    avg_dont_vape_male = mean(vec(idx{7}),'omitnan');
    avg_dont_vape_female = mean(vec(idx{8}),'omitnan');
    C = [avg_vape_male, avg_vape_female, avg_vape; avg_dont_vape_male, avg_dont_vape_female, avg_dont_vape; avg_male, avg_female, avg_whole_school];
    SD = [std(vec(idx{4}),'omitnan'),std(vec(idx{5}),'omitnan'),std(vec(idx{1}),'omitnan');std(vec(idx{7}),'omitnan'),std(vec(idx{8}),'omitnan'),std(vec(idx{6}),'omitnan');std(vec(idx{2}),'omitnan'),std(vec(idx{3}),'omitnan'),std(vec(1:N),'omitnan')];
    T_f = array2table(C,'VariableNames',{'Male','Female','Total'},'RowNames',{'Vape','Don''t Vape','Total'});
    StdDev = array2table(SD,'VariableNames',{'Male','Female','Total'},'RowNames',{'Vape','Don''t Vape','Total'});
%   TTest Table
%       Male Vape
    [~,p_mvfv,ci_mvfv,~] = ttest2(vec(idx{4}),vec(idx{5})); 
    [~,p_vmv,ci_vmv,~] = ttest2(vec(idx{4}),vec(idx{1}));
    [~,p_mvmdv,ci_mvmdv,~] = ttest2(vec(idx{4}),vec(idx{7}));
    [~,p_mvm,ci_mvm,~] = ttest2(vec(idx{4}),vec(idx{2}));
    [~,p_mvt,ci_mvt,~] = ttest2(vec(idx{4}),vec(1:N));
    
%       Female Vape
    [~,p_vfv,ci_vfv,~] = ttest2(vec(idx{5}),vec(idx{1}));
    [~,p_fvfdv,ci_fvfdv,~] = ttest2(vec(idx{5}),vec(idx{8}));
    [~,p_fvf,ci_fvf,~] = ttest2(vec(idx{5}),vec(idx{3}));
    [~,p_fvt,ci_fvt,~] = ttest2(vec(idx{5}),vec(1:N));
    
%       Male Don't Vape
    [~,p_mdvfdv,ci_mdvfdv,~] = ttest2(vec(idx{7}),vec(idx{8}));
    [~,p_mdvdv,ci_mdvdv,~] = ttest2(vec(idx{7}),vec(idx{6}));
    [~,p_mdvm,ci_mdvm,~] = ttest2(vec(idx{7}),vec(idx{2}));
    [~,p_mdvt,ci_mdvt,~] = ttest2(vec(idx{7}),vec(1:N));
    
%       Female Don't Vape
    [~,p_fdvdv,ci_fdvdv,~] = ttest2(vec(idx{8}),vec(idx{6}));
    [~,p_fdvf,ci_fdvf,~] = ttest2(vec(idx{8}),vec(idx{3}));
    [~,p_fdvt,ci_fdvt,~] = ttest2(vec(idx{8}),vec(1:N));
    
%       Male Total
    [~,p_mf,ci_mf,~] = ttest2(vec(idx{2}),vec(idx{3}));
    [~,p_mt,ci_mt,~] = ttest2(vec(idx{2}),vec(1:N));
    
%       Female Total
    [~,p_ft,ci_ft,~] = ttest2(vec(idx{3}),vec(1:N));
    
%       Vape Total
    [~,p_vdv,ci_vdv,~] = ttest2(vec(idx{1}),vec(idx{6}));
    [~,p_vt,ci_vt,~] = ttest2(vec(idx{1}),vec(1:N));
    
%       Don't Vape Total
    [~,p_dvt,ci_dvt,~] = ttest2(vec(idx{6}),vec(1:N));
    
